import React from "react";
import Footerlogo from "../../Assets/Footerlogo.png";

const Footer = () => {
  return (
    <div className=" mt-24 w-[68.75rem] bg-[#F4F4F4] mx-20">
      <div className="flex flex-row ">
        <div className="w-[177px] h-[60px]  pt-4 ml-40">
          <img
            src={Footerlogo}
            alt="Logo"
            className="w-full h-full object-contain"
          />
        </div>
        <div className=" bg-[#F4F7FF] border border-[#D9E5FF] flex gap-2 p-3 items-center justify-center h-[2rem]  mt-4 ">
          <p className=" text-sm font-semibold">Email id</p>
          <p className=" text-sm font-semibold text-[#377DFF]">
            contact@yodaplus.com
          </p>
        </div>
      </div>
    </div>
  );
};

export default Footer;
